import Axios from 'axios';
import React, {useState} from 'react';


function PostApi(){
const [title , setTitle] = useState();
const [discription , setDiscription] = useState();

const handleSubmit = (e) => {

  e.preventdefault();
  Axios.post()
}


    return(
        <>
        <div className='container'>
            <h1 className='text-center my-5'>Axios Post API</h1>
            <div className='row'>              
                <form onSubmit={handleSubmit}>
                <div className='col-12 justify-content-center'>                  
                  <div class="mb-3">
                    <label for="exampleFormControlInput1" class="form-label">Enter Title</label>
                    <input type="text" class="form-control" id="exampleFormControlInput1"
                    value={title} onChange={(e) => {setTitle(e.target.value)}}
                    placeholder="Enter Your Title" />
                   </div>
                </div>
                <div className='col-12 justify-content-center'>
                  <div class="mb-3">
                    <label for="exampleFormControlInput1" class="form-label">Enter Description</label>
                    <input type="text" class="form-control" id="exampleFormControlInput1" 
                     value={discription} onChange={(e) => {setDiscription(e.target.value)}}
                    placeholder="Enter Your Description" />
                   </div>
                </div>

                <button type="submit" className='btn btn-info'>Submit</button>
                </form> 
             
            </div>
        </div>
        </>
    )
}

export default PostApi
